    GET_PRODUCTS: (shop) => `http://localhost:8080/shopify/products/${shop}`,
    FB_AUTH: `http://localhost:8080/facebook/auth`,
    FB_INTEREST_SEARCH: `https://graph.facebook.com/v2.11/search`
}

